const common = list.data[1].filterValue.common
const keys = Object.keys(common)
// console.log(keys)

const brandList = [];

keys.forEach(k => {
    const curKeyItems = common[k];
    curKeyItems.forEach(item => {
        const tmp = {...item, tag: null}
        brandList.push(tmp)
    })
})

fs.writeFile('guazi_brands.json', JSON.stringify(brandList), (err, data) => {
    if (err) {
        console.log(err)
    } else {
        console.log('success')
    }
})
